import React from 'react'
import alarm from '../images/sunrise-alarm.svg';
import './TopBar.css'

const TopBar = () => {
    return (
        <ul>
            <li className='logo'><img src={alarm} alt="alarm"/></li>
        </ul>
    )
}

export default TopBar;
